window.bookSummaryJSON = "<p>Losing your eye in an alley bar-fight will change you. And I don't just mean physically.</p> <p>I thought my biggest hurdle was accepting that I look different. Turns out, my personal Everest is realizing that other people don't accept me.</p> <p>Specifically, women.</p> <p>I'm ready to throw in the towel on friend-of-a-friend dates and algorithmic dinners. Gonna pour myself into my gym and hire some new people. Keep myself focused on what I have, not what I don't.</p> <p>Well, that was the plan.</p> <p>Until she walked in wearing a sexy trench coat and heels, calling herself E, telling me to get to my knees.</p> <p>Now, I'm owned, I'm hers. Her sub, her pet.</p> <p>Her stray.</p> <p>The problem is, I won't survive if she doesn't keep me.</p> <p><i>Stray</i> is a femdom romance. For more information, including content warnings and tropes, please visit the author's website.</p>"; 
